  "description": {
    "nb": "Arealplaner på Svalbard følger et forenklet system i forhold til arealplaner etter Plan- og bygningsloven. Det er kun et plannivå og det plansystemet er i seg selv enklere oppbygd. I Longyearbyen arealplanområde er Longyearbyen lokalstyre planmyndighet. I de andre arealplanområdene er Sysselmannen planmyndighet, men den aktuelle aktøren er planansvarlig. Ny-Ålesund arealplanområde: Kings Bay as er planansvarligSveagruva arealplanområde: Store norske Spitsbergen Grubekompani AS er planansvarlig.Barentsburg arealplanområde: Trust Arkticugol er planansvarlig.Coles bay arealplanområde: Trust Arkticugol er planansvarlig.Pyramiden arealplanområde: Trust Arkticugol er planansvarlig.Alle arealplanområdene på Svalbard har gyldige arealplaner. I en del av områdene er det i tilleg utarbeidet en rekke delplaner."
